import React from 'react'

import PropTypes from 'prop-types'

import './create.css'

const Create = (props) => {
  return (
    <section className={`create`}>
      <h2>01</h2>
      <div>
        <h1>create</h1>
        <h3>MULTIPLE CREATIVE TOOLS</h3>
        <p>From wearables, emotes, scenes, or even names, there is an infinity of things to create and imagine! Explore all the creative tools in decentraland.</p>
      <button></button>
      </div>

      <img
        alt={props.img_alt}
        src={props.img_src}
        className="create-img"
      />

    </section>
  )
}

Create.defaultProps = {
  img_src: '/playground_assets/create.png',
  img_alt: 'image',
  rootClassName: '',
}

Create.propTypes = {
  img_src: PropTypes.string,
  img_alt: PropTypes.string,
  rootClassName: PropTypes.string,
}

export default Create
